let MBextentionId = undefined;
let requestStatus = true;
let requestError = '';
let MBResult = undefined;
let cbl = undefined;

chrome.runtime.onMessage.addListener( async function( request, sender, sendResponse ) {
  try {
    if ( request.message === 'MB_takeData' ) {
      if ( sendResponse ) sendResponse( 'done' );  // Ответ в окно опроса для поддержания канала связи
      MBextentionId = sender.id;
      switch ( request.action ) {
        case 'log&pass': {
          if ( window.location.origin === 'https://ihelper.mts.by' ) {
            // Если на странице присутствует 'div' с id='logon-container', то считаем что страница авторизации загружена ...
            if ( loginForm = document.getElementById( 'logon-container' ) !== null ) {
              authInput( request.login, request.passw );                        // ... и пробуем выполнить авторизацию
              return;
            }
            else {  // Если на странице присутствует 'div' с классом 'customer-info', то мы авторизованы и находимся на странице ЛК
              if ( document.getElementsByClassName( 'customer-info' ).length > 0 ) {
                // Перезагружаем страницу для перехода расширения к следующему этапу запроса. Этот экземпляр скрипта будет утрачен
                window.location.reload();
                return;
              }
            }
          }
          // Если попали не на 'ihelper.mts.by' или на странице нет 'div' с классом 'logon-container', то ...
          requestStatus = false;      // ... подготваливаем для расширения аттрибуты сообщения об ошибке
          console.log( requestError = `[MB] Didn't find authtorization form on the page` );
          chrome.runtime.sendMessage( MBextentionId, { message: 'MB_workTab_takeData', status: requestStatus,
                                                       error: requestError, data: undefined }, null );
          break;
        }
        case 'polling': {
          if ( window.location.origin === 'https://ihelper.mts.by' ) {
            let loginResult = document.getElementsByClassName( 'logon-result-block' );
            // Если на странице есть 'div' с классом 'logon-result-block', значит при авторизации была ошибка
            //   (логин, пароль или капча введены неправильно)
            if ( loginResult.length > 0 ) {
              requestStatus = false;  // Выдаём расширению MobileBalance ошибку и выходим
              // В этом 'div'-е должен быть вложенный 'div' с текстом ошибки
              console.log( requestError = `[MB] Authtorization error: ${loginResult[ 0 ].children[ 0 ].innerText}` );
              chrome.runtime.sendMessage( MBextentionId, { message: 'MB_workTab_takeData', status: requestStatus,
                                                           error: requestError, data: undefined }, null );
              return;
            }
            else  getData();
          }
          break;
        }
      }
    }
    else return;
  }
  catch( err ) {
    console.log( err.toString() );
    return;
  }
})


function sleep( ms ) {
//       -----------
  return new Promise( resolve => setTimeout( resolve, ms ) );
}


async function authInput( login, passw ) {
//             -------------------------
  // Находим на странице форму авторизации ('div' с классом 'logon-container') и определяем на ней элементы ввода
  let inpElem = document.getElementById( 'logon-container' ).getElementsByTagName( 'input' );
  // Задаём параметры в объекте для решения капчи
  let cbl = new CBL( {
    preprocess: function(img) {         // Последовательность операций с изображением капчи
      img.cropRelative( 8, 0, 8, 0 );
      img.blur( 1 );
      img.removeLight( 170 );
      img.sharpen( 100 );
      img.binarize( 180 );
      img.colorRegions( 50, true, 1 );  // tolerance = 50, ignoreWhite = true, pixelJump = 1 (присоединять зоны отстоящие на 1 пиксель)
    },
    // Используем ранее подготовленную модель решения капчи
    model_string: ``,
    character_set: "abcdefghijklmnopqrstuvwxyz",
    blob_min_pixels: 30,                // Минимальное кол-во пикселей для выделения изображения символа
    blob_max_pixels: 200,               // Максимальное кол-во пикселей для выделения изображения символа
    blob_max_width: 25,                 // Ограничиваем ширину изображения символа (чтобы не склеивались по два)
    pattern_width: 30,                  // Ширина приведения конечного изображения символа
    pattern_height: 40,                 // Высота приведения конечного изображения символа
    perceptive_colorspace: true,
    pattern_maintain_ratio: true
  });

  // Вносим в поля ввода учётные данные (логин и пароль)
  inpElem.ctl00_MainContent_tbPhoneNumber.value = login;                          // Вводим значение логина
  inpElem.ctl00_MainContent_tbPassword.value = passw;                             // Вводим значение пароля
  // У элемента отображение капчи 'id=captcha' - пригодно для её обработки библиотекой cbl.js, дополнительных действий не требуется
  inpElem.ctl00_MainContent_captchaBox.value = '[MB] Ждите...';
  await cbl.solve( 'captcha' ).done( function ( captchaSolution ) {               // Предпринимаем попытку решить капчу ...
    inpElem.ctl00_MainContent_captchaBox.value = captchaSolution;                 // ... и вставляем решение в поле ввода капчи
  });
  inpElem.ctl00_MainContent_btnEnter.click();                                     // "Нажимаем" кнопку отправки учётных данных серверу

  // Страница будет перезагружена и этот экземпляр скрипта утрачен
  // При успешной авторизации будет открыта страница личного кабинета
  // При ошибках будет повторно загружена стартовая страница, но с блоком ошибок
}


function initLogout() {
//       ----------
  // Передаём результаты опроса расширению
  chrome.runtime.sendMessage( MBextentionId, { message: 'MB_workTab_takeData',
                                               status: requestStatus, error: requestError,
                                               data: (MBResult === undefined) ? undefined : MBResult }, null );
  // Завершаем текущий сеанс, страница будет перезагружена + на следующем шаге её перезагрузит расширение
  window.location.replace( window.location.origin + '/Selfcare/logoff.aspx' )
}


async function getData() {
//             ---------
  fetch( window.location.origin + '/account-status.aspx', { method: 'GET', credentials: 'include' } )
  .then( function( response ) {
    response.text()
    .then( async function( response ) {
      let html = response.replace( /\r|\n|\t/g, '' );     // Преобразовывем полученный текст в одну стрку (удаляем переводы строк и табуляции)
      let result = '';
      // ---- Получаем ФИО владельца
      let regexp = /<h3>(.*?)<\/h3>/i;                    // Задаём шаблон для поиска ФИО владельца
      result = regexp.exec( html );
      MBResult = { UserName: result[ 1 ] };               // Создаём 1-ое значение объекта ответа
      // ---- Получаем тарифный план, номер лицевого счёта, баланс, статус блокировки
      regexp = /h3><ul>(.*?)<\/ul>/i;                     // Задаём шаблон для поиска данных из таблицы данных пользователя
      result = regexp.exec( html );                       // Выделяем позиции списка с данными пользователя
      result[ 1 ] = result[ 1 ].replaceAll( ',', '.' );   // Заменяем в полученных данных запятые на точки
      result[ 0 ] = result[ 1 ].split( '</li>' );         // Замещаем первый элемент массива на массив позиций списка с данными пользователя
      result[ 0 ].forEach( function( item ) {
        regexp = /<strong>(.*?)<\/strong>/ig;             // Задаём шаблон для значения в позиции списка с данными пользователя
        let tmp = regexp.exec( item );
        if ( item.includes( 'Тарифный план' ) )           // Получаем тарифный план
          MBResult.TarifPlan = tmp[ 1 ];
        if ( item.includes( 'Лицевой счет' ) )            // Получаем лицевой счёт
          MBResult.LicSchet = tmp[ 1 ];
        if ( item.includes( 'Баланс' ) ) {                // Получаем баланс
          tmp = (tmp[ 1 ].split( ' ' ))[ 0 ];
          MBResult.Balance = parseFloat( ( parseFloat( tmp ) ).toFixed( 2 ) );
        }
        if ( item.includes( 'lock-status' ) ) {           // Получаем статус блокировки
          tmp = item.split( '"lock-status">' )[ 1 ];
          MBResult.BlockStatus = ( tmp !== 'Номер не блокирован' ) ? 'Blocked' : '';
        }
      });
      // ---- Получаем остатки пакетов
      regexp = /"account-status">(.*?)<\/ul>/i;           // Задаём шаблон для поиска остатков пакетов в блоке 'Остаток неиспользованного трафика'
      result = regexp.exec( html );                       // Выделяем позиции списка с остатками пакетов
      result[ 1 ] = result[ 1 ].replaceAll( ',', '.' );   // Заменяем в полученных данных запятые на точки
      result[ 0 ] = result[ 1 ].split( '</li>' );         // Замещаем первый элемент массива на массив позиций списка с остатками пакетов
      result[ 0 ].forEach( function( item ) {
        if ( item.includes( 'inet' ) ) {                  // Получаем остатки пакета интернета
          let tmp = (item.split( 'inet: ' )[ 1 ]).split( ' ' );
          let ratio = 1; // Приводим значение к мегабайтам (размерность для ответа расширению)
          switch ( tmp[ 1 ] ) {
            case 'КБ.': {
              ratio = 0.0009765625; // Приводим значение к мегабайтам. Множитель = 1 / 1024 = 0.0009765625
              break; }
            case 'МБ.': {
              ratio = 1;            // Входное значение для расширения - мегабайты. Множитель = 1
              break; }
            case 'ГБ.': {
              ratio = 1024;         // Приводим значение к мегабайтам. Множитель = 1024
              break; }
          }
          MBResult.Internet = parseFloat( ( parseFloat( tmp[ 0 ] ) * ratio ).toFixed( 3 ) );
          // Если ранее не была принята дата следующего платежа, то пытаемся получить дату из данных остатка
          if ( ( !MBResult.TurnOffStr ) || ( MBResult.TurnOffStr === '' ) )
            MBResult.TurnOffStr = tmp[ 3 ];
        }
        if ( item.includes( 'sms' ) ) {                   // Получаем остатки пакета SMS
//          if ( ??? )  MBResult.SMS = -1                   // Если опция безлимитная, то возвращаем значение -1
//          else {
          let tmp = (item.split( 'sms: ' )[ 1 ]).split( ' ' );
          MBResult.SMS = parseInt( tmp[ 0 ] );
          // Если ранее не была принята дата следующего платежа, то пытаемся получить дату из данных остатка
          if ( ( !MBResult.TurnOffStr ) || ( MBResult.TurnOffStr === '' ) )
            MBResult.TurnOffStr = tmp[ 3 ];
//          }
        }
        if ( item.includes( 'on-net' ) ) {                // Получаем остатки пакета минут
//          if ( ??? )  MBResult.Minutes = -1               // Если опция безлимитная, то возвращаем значение -1
//          else {
          let tmp = (item.split( 'on-net: ' )[ 1 ]).split( ' ' );
          MBResult.Minutes = parseInt( tmp[ 0 ] );
          // Если ранее не была принята дата следующего платежа, то пытаемся получить дату из данных остатка
          if ( ( !MBResult.TurnOffStr ) || ( MBResult.TurnOffStr === '' ) )
            MBResult.TurnOffStr = tmp[ 3 ];
//          }
        }
        if ( item.includes( 'во все сети' ) ) {           // Получаем остатки пакета минут
//          if ( ??? )  MBResult.Minutes = -1               // Если опция безлимитная, то возвращаем значение -1
//          else {
          let tmp = (item.split( 'во все сети: ' )[ 1 ]).split( ' ' );
          MBResult.Minutes = parseInt( tmp[ 0 ] );
          // Если ранее не была принята дата следующего платежа, то пытаемся получить дату из данных остатка
          if ( ( !MBResult.TurnOffStr ) || ( MBResult.TurnOffStr === '' ) )
            MBResult.TurnOffStr = tmp[ 3 ];
//          }
        }
      });
      // Проверяем наличие безлимитных опций по интернету
      result = await (await fetch( window.location.origin + `/Selfcare/Services/mtsrequestv3.ashx?r=` +
                                   `${Math.random()}&code=selfcare&method=getquotes&js=account-status&data=null`,
                                   { method: 'GET', credentials: 'include' })
                     ).text();
      if ( result.includes( 'Безлимит' ) )  MBResult.Internet = -1;     // Опция безлимитная, возвращаем значение -1
      // Если ранее не была принята дата следующего платежа, то пытаемся получить дату из данных остатка
      if ( ( !MBResult.TurnOffStr ) || ( MBResult.TurnOffStr === '' ) ) {
        tmp = result.split( 'обновление <b>' )[ 1 ].split( ' ' )[ 0 ];
        MBResult.TurnOffStr = tmp;
      }

      fetch( window.location.origin + '/product-2-view.aspx', { method: 'GET', credentials: 'include' } )
      .then( function( response ) {
        response.text()
        .then( function( response ) {
          let freeCounter = 0, paidCounter = 0, paidAmmount = 0;
          let result = [], tmp = '';
          let html = response.replace( /\r|\n|\t/g, '' );   // Преобразовывем полученный текст в одну стрку (удаляем переводы строк и табуляции)
          html = html.replaceAll( ',', '.' );               // Заменяем в полученных данных запятые на точки
          // ---- Получаем список услуг
          let regexp = /"gm-row-item gm-group-level-1">(.*?)<\/tr>/ig;        // Задаём шаблон для поиска позиций списка услуг
          do {                                                                // Собираем позиции списка услуг в массив
            tmp = regexp.exec( html );
            if ( tmp !== null )
              result.push( tmp );
          } while( tmp !== null );
          result.forEach( function( item ) {
            tmp = item[ 1 ].split( '"classname-' )[ 1 ];
            // Ежедневную оплату приводим к месячному периоду, умножая её на 30 дней
            let ratio = ( tmp.includes( 'day' ) ) ? 30 : 1;
            tmp = tmp.split( '<span>' )[ 1 ].split( '/' )[ 0 ];
            tmp = parseFloat( tmp ) * ratio;
            if ( tmp > 0 ) {
              ++paidCounter;
              paidAmmount += parseFloat( tmp );
            }
            else
              ++freeCounter;
          });
          // Формируем строку в формате: 'бесплатные' / 'платные' / (сумма по платным)
          MBResult.UslugiOn = `${freeCounter} / ${paidCounter} (${paidAmmount.toFixed(2)})`;

          fetch( window.location.origin + '/bonus.aspx', { method: 'GET', credentials: 'include' } )
          .then( function( response ) {
            response.text()
            .then( function( response ) {
              let html = response.replace( /\r|\n|\t/g, '' );   // Преобразовывем полученный текст в одну стрку (удаляем переводы строк и табуляции)
              html = html.replaceAll( ',', '.' );               // Заменяем в полученных данных запятые на точки
              // ---- Получаем количество бонусных баллов и баллов к списанию
              let regexp = /balance-allcount">.*?(\d+).*?<\/span>/i;          // Задаём шаблон для поиска значения бонусных баллов
              result = regexp.exec( html );
              result[ 0 ] = parseFloat( result[ 1 ] );
              if ( result[ 0 ] > 0 )
                MBResult.Balance2 = result[ 0 ];
              regexp = /будет списано.*?(\d+).*?<\/div>/i;                    // Задаём шаблон для поиска значения баллов к списанию
              result = regexp.exec( html );
              result[ 0 ] = parseFloat( result[ 1 ] );
              if ( result[ 0 ] > 0 )
                MBResult.Balance3 = result[ 0 ];

              initLogout();       // Завешаем сеанс работы в личном кабинете

            })
            .catch( function( err ) { fetchError( `Error getting TEXT from '/bonus.aspx' response: ${err.message}` ) } )
          })
          .catch( function( err ) { fetchError( `Fetch error getting '/bonus.aspx': ${err.message}` ) } )
        })
        .catch( function( err ) { fetchError( `Error getting TEXT from '/product-2-view.aspx' response: ${err.message}` ) } )
      })
      .catch( function( err ) { fetchError( `Fetch error getting '/product-2-view.aspx': ${err.message}` ) } )
    })
    .catch( function( err ) { fetchError( `Error getting TEXT from '/account-status.aspx' response: ${err.message}` ) } )
  })
  .catch( function( err ) { fetchError( `Fetch error getting '/account-status.aspx': ${err.message}` ) } )

  function fetchError( err ) {
  //       ----------
    requestStatus = false;
    console.log( requestError = `[MB] ${err}` );
    initLogout();
  }
}


